INSERT INTO FORM_TEMPLATE (ID_, COMPONENTID_, CREATEBY_, CREATEDATE_, DELETEFLAG_, NAME_, TEMPLATE_, TYPE_) VALUES (3, 33, 'admin', '2015-04-30 17:40:14', 0, 'source', 'function {{id}}filter(treeId, parentNode, childNodes) {
	if (!childNodes)
		return null;
	for (var i = 0, l = childNodes.length; i < l; i++) {
		childNodes[i].name = childNodes[i].{{namekey}};
		childNodes[i].indexkey = childNodes[i].{{indexkey}};
		childNodes[i].idkey = childNodes[i].{{idkey}};
		childNodes[i].pidkey = childNodes[i].{{pidkey}};
		if(''{{icon}}''!='''' && childNodes[i][''{{icon}}'']){
			childNodes[i].icon = contextPath+childNodes[i][''{{icon}}''];
		}
		if(''{{iconopen}}''!='''' && childNodes[i][''{{iconopen}}'']){
			childNodes[i].iconOpen = contextPath+childNodes[i][''{{iconopen}}''];
		}
		if(''{{iconclose}}''!='''' && childNodes[i][''{{iconclose}}'']){
			childNodes[i].iconClose = contextPath+childNodes[i][''{{iconclose}}''];
		}
	}
	return childNodes;
}
function {{id}}BeforeDrop(treeId, treeNodes, targetNode, moveType,isCopy) {
	return glafZtree.beforeDrop(treeId, treeNodes, targetNode, moveType,isCopy,''{{ruleid}}'') 
};
function {{id}}BeforeRemove(treeId, treeNode) {
	return glafZtree.beforeRemove(treeId, treeNode,''{{ruleid}}'');
}
function {{id}}BeforeRename(treeId, treeNode, newName, isCancel ) {
	return glafZtree.beforeRename(treeId, treeNode, newName, isCancel, ''{{ruleid}}'')
}
function {{id}}OnClick(event, treeId, treeNode,clickFlag){
	  {{click}}
}
