$("#ztree_{{id}}_add_next").kendoButton({click:function(){glafZtree.ztreeToolbar(''next'',''{{id}}'',''{{ruleid}}'',{{editpanleautoclose}});}});
$("#ztree_{{id}}_edit").kendoButton({click:function(){glafZtree.ztreeToolbar(''edit'',''{{id}}'',''{{ruleid}}'',{{editpanleautoclose}});}});
$("#ztree_{{id}}_del").kendoButton({click:function(){glafZtree.ztreeToolbar(''del'',''{{id}}'',''{{ruleid}}'',{{editpanleautoclose}});}});
