			rootPId: ''-1''
		}
	},
	check:{
		enable:{{checkenable}},
		chkStyle:''{{chkstyle}}'',
		chkboxType: { "Y": "s", "N": "s" },
	},
	callback: {
		beforeClick: {{ztreeBeforeClick}},
		beforeRename: {{id}}BeforeRename,
		beforeRemove: {{id}}BeforeRemove,
		beforeDrop: {{id}}BeforeDrop,
		onClick: {{id}}OnClick,
	},
	edit: {
